const data = [
  {
    id: "my-site",
    label: "menu.my-site",
    to: "/app/gogo",
    subs: [
      {
        label: "menu.dashboard",
        to: "/app/gogo/start"
      },
      {
        label: "menu.site-information",
        to: "/app/gogo/start"
      }
    ]
  },
  {
    id: "products",
    label: "menu.products",
    to: "/app/second-menu",
    subs: [
      {
        label: "menu.second",
        to: "/app/second-menu/second"
      }
    ]
  },
  {
    id: "people",
    label: "menu.people",
    to: "/app/aaa-menu",
    subs: [
      {
        icon: "simple-icon-paper-plane",
        label: "menu.second",
        to: "/app/second-menu/second"
      }
    ]
  }
];
export default data;
